$(document).ready(function(){$(".pagination").rPage();$(".credits-modal").click(function(){$("#credits").modal()});$(".alert-warning").delay(2e4).slideToggle();$(".alert-success").delay(5e3).slideToggle();$(".alert-danger").delay(1e4).slideToggle();$(".btn-success").click(function(){var e=$(this);e.button("loading")});$("img").on().tooltip();$(".admintooltip").on().tooltip();$(".jobtooltip").on().tooltip();window.addEventListener("load",function(){setTimeout(function(){window.scrollTo(0,1)},0)});$("#calculations").click(function(){$.blockUI({message:"&{'app.calculating'}"});setTimeout($.unblockUI,1e5)});if($(".editable").length>0){$(".editable").editable({success:function(e,t){iosOverlay({text:"&{'app.update.saved'}",duration:2e3,icon:"/public/img/check.png"})}});$(".updateable").click(function(){var e=$(this).attr("data-url");if(e!=null){$.get(e).done(function(){iosOverlay({text:"&{'app.update.saved'}",duration:2e3,icon:"/public/img/check.png"})}).fail(function(){iosOverlay({text:"&{'app.update.error'}",duration:2e3,icon:"/public/img/cross.png"})})}})}$("#extratips").on("hidden.bs.collapse",function(){$("#collapseExtra").text("&{'app.show'}")});$("#extratips").on("show.bs.collapse",function(){$("#collapseExtra").text("&{'app.hide'}")})})